import React from 'react';
import GalleryData from './GalleryData';


function NFT_Page(){
    
    
    return(
        <>
        <div className='nft'>
            {GalleryData.map(function(images){return(<div>{images.imageName}</div>)})}
        </div>
        </>
    )
}

export default NFT_Page;
